import { AppContext } from "../context";

import User from './User'

const UserList =()=>{


    const {users} =useContext(AppContext)

    return(
        <>

        <h3>Available User</h3>
        {users.map(user =>  <User key={user.id} user={user}/>)}
        </>
    )
}
